import React, { useState } from 'react';

const Gallery = (props) => {
    const[img,setImg]=useState([])

  const handle=(event)=>{
    console.log(event)
    setImg(event)
  }
 



    return (
        <>

        <div className="col-md-6 col-6 mx-auto">
            <figure className="gal_img">
            <img className="img-fluid" src={props.img} alt="image" onClick={event=>handle(event.target.src)}>
        </img>
            </figure>
        </div>
        <img src={img}/>

    


        </>
    )
}

export default Gallery
